import HistoryInfo from '../ProfileInfo/HistoryInfo/HistoryInfo'
import ProfileInfo from '../ProfileInfo/ProfileInfo'
import './Home.css'
import { useState } from 'react'


export default function Home(username) {
    const localUser = JSON.parse(localStorage.getItem('user'))
    const [paginationComponent, setPaginationComponent] = useState(null);
    const handleSetPaginationComponent = (component) => {
        setPaginationComponent(component);
    };

  return (

          <div className="homeWrapper">
                  <ProfileInfo username={username}/>

              {(localUser._id!==username.username.username && localUser.isAdmin) || localUser._id===username.username.username ?
                  <HistoryInfo setPaginationComponent={handleSetPaginationComponent}/> :''
              }

          </div>
  )
}
